import React from "react";
import Stack from "@mui/material/Stack";
import Box from "@mui/material/Box";
import LockIcon from "@mui/icons-material/Lock";
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import TextField from '@mui/material/TextField';

function SignUp(props) {
  return (
    <Stack justifyContent='center' alignItems="center" sx={{height:"100vh",border:"1px solid "}} spacing={4} >
      <Box>
        <Box>
          <LockIcon />
        </Box>
      </Box>
      <Box width="30%">
        <TextField label="Outlined secondary" color="secondary" focused />
        <TextField m={2} label="Outlined secondary" color="secondary" focused />
      </Box>
      <Box width="30%">
        <TextField sx={{width:"100%"}} label="Outlined secondary" color="secondary" focused />
      </Box>
      <FormGroup>
        <FormControlLabel control={<Checkbox defaultChecked />} label="I want to recieve inspiration and marketing promotion and updates from" />
      </FormGroup>
    </Stack>
  );
}

export default SignUp;
